import React from "react";

function AProposPage() {
  console.log("AProposPage est rendu");
  return (
    <div className="main">
      <h1>A Propos Page</h1>
      <p>
        Chuck Norris can have both feet on the ground and kick butt at the same
        time. Death once had a near-Chuck-Norris experience. Bigfoot claims he
        once saw Chuck Norris. Chuck Norris’ tears cure cancer. Too bad he has
        never cried. Chuck Norris can speak Braille. Chuck Norris plays Jenga
        with Stonehenge. What’s the strongest part of Chuck Norris? His opinion.
        Chuck Norris narrates Morgan Freeman’s life. When Chuck Norris was born
        he drove his mom home from the hospital. Chuck Norris’ cowboy boots are
        made from real cowboys. Chuck Norris can squeeze orange juice out of a
        lemon. Chuck Norris can have both feet on the ground and kick butt at
        the same time. Chuck Norris can dribble a bowling ball. Chuck Norris can
        play the violin with a piano. Chuck Norris narrates Morgan Freeman’s
        life.
      </p>
    </div>
  );
}

export default AProposPage;
